commit.message:
Incorporate PR feedback.

* remove debugging code and some other dead code;
* make `Contents` into its own trait, rather than just using `\/`;
* restrict the ShapePreservingOp reordering to eliminate some invalid
 cases (I have a test case for this, but it depends on another fix that
 results in fixing #488, so it’s waiting on that);
* change a couple `WorkflowBuilder.merge` cases that prevented some
 parallel flattenings from unifying (added a test case); and
* replace `expr3` with `expr`, which uses `fold1Builders` (fixes #521).
